    align-items: center;
    text-align: center;
    display: flex;
    flex-direction: column;
    justify-content: center;

`

const Circle = styled.div`

    width : 30px;
    height : 30px;
    border-radius: 50%;
    background-color: orange;

    float: left;
    margin: 0px 5px;
`
export default Daily
